DROP TABLE IF EXISTS `note`;
CREATE TABLE `note` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `useId` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '作品所属用户',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '作品标题',
  `note_type` varchar(255) NOT NULL DEFAULT '' COMMENT '作品分类',
  `note_content` longtext,
  `is_collection` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否收藏，0，否，1是',
  `c_time` varchar(50) DEFAULT NULL,
  `m_time` varchar(50) DEFAULT NULL,
  `head_img` longtext,
  `collection_id` int(11) DEFAULT NULL,
  `nickname` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='用户的作品';

