INSERT INTO `note` VALUES ('8', '15', '等你，在这飘雪的季节', '旅行', '<p>等你，在这飘雪的季节</p><p>这个世界</p><p>因你的到来</p><p>变得安静而和谐</p><p>你的妩媚、飘然</p><p>让<a href=\"https://www.duanwenxue.com/qinggan/gushi/\" target=\"_blank\" style=\"color: rgb(102, 102, 102);\">故事</a>的情节生动了许多</p><p>你的剔透、洁美</p><p>是用爱心在给世间着色</p><p>你的出现</p><p>浸染着正义和善良</p><p>你的飘扬</p><p>闪烁着人性的光泽</p><p>你来了</p><p>迈着轻盈的脚步而来</p><p>心灵碰撞更能催人泪下</p><p>温暖带来<a href=\"https://www.duanwenxue.com/diary/xingfu/\" target=\"_blank\" style=\"color: rgb(102, 102, 102);\">幸福</a>的感觉</p><p>你真的来了</p><p>就在这个飘雪的午夜</p><p>唐诗宋词伴着悠扬的旋律</p><p>闪亮着我的内心世界</p>', '0', '2018年12月05', '2018年12月05', 'data:image/jpeg;base64,', null, '十三哥');
